import React from 'react';


type OnOffType = {
    work:boolean
}



const StyleButtonON = {
    width:'30px',
    height:'30px',
    border: '1px solid black',
    backgroundColor:'green'
}

const StyleButtonOFF = {
    width:'30px',
    height:'30px',
    border: '1px solid black',
    backgroundColor:'red'
}

export const OnOff = (props:OnOffType) => {

    const Style = {
        width:'30px',
        height:'30px',
        borderRadius:'15px',
        display:'inline-block',
        border: '1px solid black',
        backgroundColor:props.work ? 'green':'red',
        marginLeft:'5px'
    }
    return ( <span>

            <span style={StyleButtonOFF}>
               OFF
            </span>
            <span style={StyleButtonON}>
                ON
            </span>
            <span style={Style}>

            </span>
        </span>

    );
};
